function initMap(){var n=new google.maps.LatLng(59.258944,15.2320114),t={zoom:15,center:n,mapTypeId:google.maps.MapTypeId.ROADMAP};map=new google.maps.Map(document.getElementById("kontakt-map"),t)}var map;$(function(){$("#kontaktModal").on("shown.bs.modal",function(){google.maps.event.trigger(map,"resize")});$("a.page-scroll").bind("click",function(n){var t=$(this);$("html, body").stop().animate({scrollTop:$(t.attr("href")).offset().top},1500,"easeInOutExpo");n.preventDefault()});$("#nav").affix({offset:{top:$("#nav").offset().top}})});